pragma solidity ^0.5.11;

contract swapToken{
    //this contract is a simple demo(not full code) on swapping a token with ether(1 TOK=1 ETHER)


    address payable mainWallet;


    mapping(address => uint256)   balances;


    event Purchase(

        address buyer,
        uint256 amount

    );
     using SafeMath for uint256;

    //set the one who deploys the contract as the main wallet
    constructor (address payable  _wallet) public{

        mainWallet=_wallet;

    }

    function getWallet() public view returns (address payable){


      return mainWallet;
    }

    function buyToken() external {


        //send ether to main wallet
        //msg.value is the value we put into the right hand side.the amount of ether.
        mainWallet.transfer(1 ether);
         emit Purchase(msg.sender,1);


    }

    function transfer( uint noEther) public returns (bool) {



        require(noEther <= balances[msg.sender], "Sender there's no enough funds.");

        balances[msg.sender] = balances[msg.sender].sub(noEther);
        balances[mainWallet] = balances[mainWallet].add(noEther);

        return true;


    }














}



library SafeMath {
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
      assert(b <= a);
      return a - b;
    }

    function add(uint256 a, uint256 b) internal pure returns (uint256) {
      uint256 c = a + b;
      assert(c >= a);
      return c;
    }
}
